import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import state, { addPost } from './Redux/State';




const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App state={state} addPost={addPost}/>

  </React.StrictMode>
);

